INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (713, 'AT', 'en', 'vfg.group.login.signup.used.text.de.cloud', 'F\u00FCr diese Handynummer existiert bereits ein Benutzerkonto f\u00FCr einen Vodafone Dienst.<br><br>Bitte verwenden Sie zur Anmeldung Ihre Handynummer und das Passwort bzw. den mobilen Zugangscode, den Sie auch in der App verwenden. Sie wissen den Code oder das Passwort nicht mehr? - Dann klicken Sie auf den Link \"Passwort vergessen?\", um Ihr Passwort zur\u00FCckzusetzen.<br><br><b>Hinweis:<\/b> Wenn Sie bereits bei <b>Vodafone Cloud<\/b> registriert sind, k\u00F6nnen Sie sich mit diesen Benutzerdaten (Mobilfunknummer und Cloud-Passwort) auch f\u00FCr Vodafone Contacts anmelden. Eine erneute Registrierung ist nicht erforderlich.', '');
