INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (724, 'AT', 'en', 'vfg.msisdn.login.help.text.above.form', '<b>Hinweis:<\/b> Sie haben sich bereits f\u00FCr das Vodafone Adressbuch oder die Vodafone Cloud registriert? Dann k\u00F6nnen Sie sich direkt mit demselben mobilen Zugangscode, den Sie per SMS erhalten haben, anmelden.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (725, 'AT', 'en', 'vfg.msisdn.login.help.text.above.form.de.contacts', '<b>NEU:<\/b> Wir haben die Leistungen des Vodafone Adressbuchs weiter verbessert. Ihr <u>MeinVodafone-<\/u>Zugang wird f\u00FCr die Anmeldung zu Vodafone Adressbuch jedoch ab sofort <u>nicht mehr unterst\u00FCtzt<\/u>.<br>Bitte verwenden Sie zur Anmeldung das Passwort bzw. den mobilen Zugangscode, den Sie auch in der App verwenden. Sollten Sie diesen nicht mehr haben, nutzen Sie den \"Passwort vergessen?\"-Link, um Ihr Passwort zur\u00FCckzusetzen.<br><br><b>Hinweis:<\/b> Wenn Sie bereits bei <b>Vodafone Cloud<\/b> registriert sind, k\u00F6nnen Sie sich direkt mit denselben Benutzerdaten (Mobilfunknummer und Cloud-Passwort) auch f\u00FCr Vodafone Adressbuch anmelden. Eine erneute Registrierung ist nicht erforderlich.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (726, 'AT', 'en', 'vfg.msisdn.login.help.text.above.form.de.nwab', '<b>NEU:<\/b> Wir haben die Leistungen des Vodafone Adressbuchs weiter verbessert. Ihr <u>MeinVodafone-<\/u>Zugang wird f\u00FCr die Anmeldung zu Vodafone Adressbuch jedoch ab sofort <u>nicht mehr unterst\u00FCtzt<\/u>.<br>Bitte verwenden Sie zur Anmeldung das Passwort bzw. den mobilen Zugangscode, den Sie auch in der App verwenden. Sollten Sie diesen nicht mehr haben, nutzen Sie den \"Passwort vergessen?\"-Link, um Ihr Passwort zur\u00FCckzusetzen.<br><br><b>Hinweis:<\/b> Wenn Sie bereits bei <b>Vodafone Cloud<\/b> registriert sind, k\u00F6nnen Sie sich direkt mit denselben Benutzerdaten (Mobilfunknummer und Cloud-Passwort) auch f\u00FCr Vodafone Adressbuch anmelden. Eine erneute Registrierung ist nicht erforderlich.', '');
