INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1654, 'DE', 'en', 'lccomms.passcodeSMS', 'Der mobile Zugangscode f\u00FCr Ihren Vodafone Dienst lautet: $param.passcode', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1655, 'DE', 'en', 'lccomms.passwordEmail.Body.ChangePassword', 'Sie nutzen Vodafone Adressbuch und\/oder Vodafone Cloud und haben ein neues Passwort angefordert.<br><br><b><u>Bitte beachten Sie:<\/b><\/u> F\u00FCr beide Dienste gilt dasselbe Passwort!<br><br>Sie ben\u00F6tigen Ihr neues Passwort zuk\u00FCnftig f\u00FCr die Anmeldung bei Vodafone Cloud im Web sowie der Cloud-App und auch als neuen mobilen Zugangscode in der Adressbuch-App.<br><br>Bitte w\u00E4hlen Sie bei n\u00E4chster Gelegenheit selbst ein neues, sicheres Passwort aus. Sie k\u00F6nnen dies auf der Webseite in den Einstellungen \u00E4ndern.<br><br>', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1656, 'DE', 'en', 'lccomms.passwordEmail.Body.Greeting', 'Lieber Vodafone-Kunde!', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1657, 'DE', 'en', 'lccomms.passwordEmail.Body.Password', 'Ihr neues Passwort lautet: $param.passcode', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1658, 'DE', 'en', 'lccomms.passwordEmail.Subject', 'Vodafone - Ihr neues Passwort', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1659, 'DE', 'en', 'lccomms.passwordResetEmail.Body.Greeting', 'Lieber Vodafone-Kunde!<br><br>Sie nutzen Vodafone Adressbuch und\/oder Vodafone Cloud und m\u00F6chten Ihr Passwort oder Ihren mobilen Zugangscode zur\u00FCcksetzen.<br><br><b>Bitte beachten Sie: F\u00FCr beide Dienste gilt dasselbe Passwort!<\/b><br><br>Sie ben\u00F6tigen Ihr neues Passwort f\u00FCr die Anmeldung bei Vodafone Cloud und\/oder Vodafone Adressbuch im Web und der jeweiligen App.<br><br>', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1660, 'DE', 'en', 'lccomms.passwordResetEmail.Body.PasswordResetLink', 'Sie k\u00F6nnen Ihr Passwort zur\u00FCcksetzen, indem Sie hier klicken.<br><br>', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1661, 'DE', 'en', 'lccomms.passwordResetEmail.Body.PlainText', 'Lieber Vodafone-Kunde!\n\nSie nutzen Vodafone Adressbuch und\/oder Vodafone Cloud und m\u00F6chten Ihr Passwort oder Ihren mobilen Zugangscode zur\u00FCcksetzen. \n\nBitte beachten Sie: F\u00FCr beide Dienste gilt dasselbe Passwort! \n\nSie ben\u00F6tigen Ihr neues Passwort f\u00FCr die Anmeldung bei Vodafone Cloud und\/oder Vodafone Adressbuch im Web und der jeweiligen App.\n\nSie k\u00F6nnen Ihr Passwort zur\u00FCcksetzen, indem Sie folgenden Link kopieren \nund in die Adresszeile Ihres Browsers einf\u00FCgen:\n\n$param.baseurl\/confirmpassword?code=$param.pin&namespace=$param.namespace&email=$param.email&opco=DE&service=$param.servicecode\n\nWir w\u00FCnschen Ihnen weiterhin viel Spa\u00DF mit Vodafone. \n\nViele Gr\u00FC\u00DFe!\n\nIhr Vodafone-Team', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1662, 'DE', 'en', 'lccomms.passwordResetEmail.Body.Thankyou', 'Wir w\u00FCnschen Ihnen weiterhin viel Spa\u00DF mit Vodafone.<br><br>Viele Gr\u00FC\u00DFe!<br><br>Ihr Vodafone-Team', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1663, 'DE', 'en', 'lccomms.passwordResetEmail.Body.VodafoneTeam', 'Ihr Vodafone-Team', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1664, 'DE', 'en', 'lccomms.passwordResetEmail.Subject', 'Vodafone \u2013 Passwort Zur\u00FCcksetzung', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1665, 'DE', 'en', 'lccomms.passwordSMS', 'Ihr neues Vodafone Passwort f\u00FCr Adressbuch und\/oder Cloud lautet: $param.passcode. Sie k\u00F6nnen es \u00FCber die \nVerwaltung Ihres Accounts jederzeit \u00E4ndern', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1666, 'DE', 'en', 'lccomms.verificationEmail.Body.Thankyou', 'Viele Gr\u00FC\u00DFe!', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1667, 'DE', 'en', 'lccomms.verificationEmail.Body.VerifyLink', 'Best\u00E4tigen Sie bitte Ihre E-Mail-Adresse, indem Sie auf diesen Link klicken.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1668, 'DE', 'en', 'lccomms.verificationEmail.Body.VodafoneTeam', 'Ihr Vodafone $param.service-Team', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1669, 'DE', 'en', 'lccomms.verificationEmail.Body.Welcome', 'Lieber Vodafone $param.service-Kunde!', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1670, 'DE', 'en', 'lccomms.verificationEmail.ServiceSpecific.Cloud', 'Entdecken Sie die M\u00F6glichkeiten der Vodafone Cloud einschlie\u00DFlich aller Anwendungen f\u00FCr Ihre Ger\u00E4te auf www.vodafone.de\/cloud.<br><br>Bitte beachten Sie&#44; dass Sie ohne die Best\u00E4tigung Ihrer E-Mail-Adresse Vodafone Cloud nicht in vollem Umfang nutzen zu k\u00F6nnen.<br><br>Ihre best\u00E4tigte E-Mail-Adresse gilt sowohl f\u00FCr Vodafone Cloud als auch f\u00FCr Vodafone Adressbuch&#44; sofern Sie diesen Dienst zuk\u00FCnftig auch nutzen.<br><br>Und nun w\u00FCnschen wir Ihnen viel Spa\u00DF mit der Vodafone Cloud.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1671, 'DE', 'en', 'lccomms.verificationEmail.ServiceSpecific.Music', '&nbsp;Vodafone Music bietet Ihnen eine Auswahl von Millionen von Titeln und Alben&#44; die Sie bequem auf Ihren Computer oder Ihr Handy herunterladen k\u00F6nnen<br>&nbsp;-&nbsp;Sichern Sie sich Ihre ersten 10 Titel kostenlos mit unserem preisg\u00FCnstigen 10er MP3-Paket<br>&nbsp;-&nbsp;Holen Sie sich die kostenlose Vodafone Music App f\u00FCr Ihr Android&#44; BlackBerry oder Java Handy', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1672, 'DE', 'en', 'lccomms.verificationEmail.ServiceSpecific.NWAB', 'Bitte beachten Sie&#44; dass Sie ohne die Best\u00E4tigung Ihrer E-Mail-Adresse das Vodafone Adressbuch nicht in vollem Umfang nutzen zu k\u00F6nnen.<br><br>Sie k\u00F6nnen Ihr Handy oder die Webseite <a href&#61;\"http:\/\/adressbuch.vodafone.de nutzen\">http:\/\/adressbuch.vodafone.de<\/a> nutzen&#44; um Ihre Kontakte einzusehen und zu bearbeiten.<br><br>Ihre best\u00E4tigte E-Mail-Adresse gilt sowohl f\u00FCr Vodafone Adressbuch als auch f\u00FCr Vodafone Cloud&#44; sofern Sie diesen Dienst zuk\u00FCnftig auch nutzen.<br><br>Und nun w\u00FCnschen wir Ihnen viel Spa\u00DF mit dem Vodafone Adressbuch.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1673, 'DE', 'en', 'lccomms.verificationEmail.Subject', 'Vodafone \u2013 Bitte best\u00E4tigen Sie Ihre E-Mail-Adresse', '');
