INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1891, 'DE', 'en', 'vfg.group.login.signup.used.text', 'Wir haben festgestellt, dass Sie bereits f\u00FCr ${services} registriert sind.<br>Wenn Sie nicht Ihre Daten verlieren m\u00F6chten, melden Sie sich bitte mit Ihren vorhandenen Benutzerdaten an.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1892, 'DE', 'en', 'vfg.group.login.signup.used.text.cloud', 'Warnung<br>F\u00FCr diese Mobilnummer existiert bereits ein Benutzerkonto f\u00FCr einen anderen Vodafone Dienst, z.B Vodafone Adressbuch. Bitte verwenden sie zum Anmelden Ihre Benutzerdaten (Mobilnummer und mobilen Zugangscode als Passwort). Sollten sie die SMS mit ihren mobilen Zugangscode nicht mehr haben, so verwenden Sie den Passwort vergessen Link, um f\u00FCr VF Cloud und die Adresssbuch-App die Benutzerdaten zu erneuern.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (1893, 'DE', 'en', 'vfg.group.login.signup.used.text.de.cloud', 'F\u00FCr diese Mobilfunknummer existiert bereits ein Benutzerkonto f\u00FCr einen Vodafone Dienst.<br><br>Bitte verwenden Sie zur Anmeldung Ihre Mobilfunknummer sowie das Passwort bzw. den mobilen Zugangscode, den Sie auch in der App verwenden. Sollten Sie diesen nicht mehr haben, nutzen Sie den \"Passwort vergessen?\"-Link, um Ihr Passwort zur\u00FCckzusetzen.<br><br><b>Hinweis:<\/b> Wenn Sie bereits bei <b>Vodafone Cloud<\/b> registriert sind, k\u00F6nnen Sie sich direkt mit denselben Benutzerdaten (Mobilfunknummer und Cloud-Passwort) auch f\u00FCr Vodafone Adressbuch anmelden. Eine erneute Registrierung ist nicht erforderlich.', '');
