INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (4758, 'IT', 'en', 'vfg.msisdn.signup.label.details', 'Benvenuto nella pagina di registrazione.<br>Se sei <b>gi\u00E0 registrato<\/b> a Vodafone Cloud, Vodafone Contacts o Vodafone Protect, utilizza le stesse credenziali (numero Vodafone e password) e fai Login.  Altrimenti procedi con la registrazione al servizio.<br><br><b>Sei un cliente ADSL?<\/b><br><span>Per procedere con la registrazione \u00E8 necessario navigare da casa con l''ADSL Vodafone e la Internet Key inserita nell''apposito alloggiamento della Vodafone Station. Per registrarti utilizza come identificativo il numero della tua Internet Key abbinata alla Vodafone Station (Non lo ricordi? <a href=\"http:\/\/www.vodafone.it\/portal\/client\/cms\/viewCmsPage.action?pageId=42375\">Clicca qui<\/a>).<\/span>', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (4759, 'IT', 'en', 'vfg.msisdn.signup.label.details.contacts', 'Benvenuto nella pagina di registrazione.<br>Se sei <b>gi\u00E0 registrato<\/b> a Vodafone Cloud, Vodafone Contacts o Vodafone Protect, utilizza le stesse credenziali (numero Vodafone e password) e <a href=\"https:\/\/vfglogin.vodafone.it\/group\/loginmsisdn?returnUrl=https:\/\/cloud.vodafone.it\/web\/app\/vault&opco=it&service=contacts&channel=web&returnurl=https:\/\/contacts.vodafone.it\/web\/default\/welcome.vhtml\">fai Login<\/a>.  Altrimenti procedi con la registrazione al servizio.<br><br><b>Sei un cliente ADSL?<\/b><br><span>Per procedere con la registrazione \u00E8 necessario navigare da casa con l''ADSL Vodafone e la Internet Key inserita nell''apposito alloggiamento della Vodafone Station. Per registrarti utilizza come identificativo il numero della tua Internet Key abbinata alla Vodafone Station (Non lo ricordi? <a href=\"http:\/\/www.vodafone.it\/portal\/client\/cms\/viewCmsPage.action?pageId=42375\">Clicca qui<\/a>).<\/span>', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (4760, 'IT', 'en', 'vfg.msisdn.signup.label.details.contentbackup', 'Benvenuto nella pagina di registrazione.<br>Se sei <b>gi\u00E0 registrato<\/b> a Vodafone Cloud, Vodafone Contacts o Vodafone Protect, utilizza le stesse credenziali (numero Vodafone e password) e <b><a href=\"https:\/\/vfglogin.vodafone.it\/group\/loginmsisdn?returnUrl=https:\/\/cloud.vodafone.it\/web\/app\/vault&opco=it&service=contentbackup&channel=web&returnurl=https:\/\/cloud.vodafone.it\/web\/app\/vault\">fai Login<\/a><\/b>. Altrimenti procedi con la registrazione al servizio.<br><br><b>Sei un cliente ADSL o FIBRA?<\/b><br>Inserisci il numero della SIM Dati abbinata alla tua Vodafone Station.<br><br>Se hai la Vodafone Internet Key inserita nella Vodafone Station <a href=\"http:\/\/www.vodafone.it\/portal\/client\/cms\/viewCmsPage.action?pageId=42375\">clicca qui<\/a> per recuperare il numero della tua SIM Dati.<br>Se hai la SIM Dati inserita in un dispositivo mobile, vai alla pagina contatori.vodafone.it navigando con la SIM Dati inserita nel dispositivo mobile e visualizza il numero.', '');
INSERT INTO app_translation(app_translation_id, country, language, name, value, description) VALUES (4761, 'IT', 'en', 'vfg.msisdn.signup.label.details.mobileprotect', 'Benvenuto nella pagina di registrazione.<br>Se sei <b>gi\u00E0 registrato<\/b> a Vodafone Cloud, Vodafone Contacts o Vodafone Protect, utilizza le stesse credenziali (numero Vodafone e password) e <a href=\"https:\/\/vfglogin.vodafone.it\/group\/loginmsisdn?returnUrl=https:\/\/cloud.vodafone.it\/web\/app\/vault&opco=it&service=mobileprotect&channel=web&returnurl=https:\/\/protect.vodafone.it\/Home\">fai Login<\/a>.  Altrimenti procedi con la registrazione al servizio.<br><br><b>Sei un cliente ADSL?<\/b><br><span>Per procedere con la registrazione \u00E8 necessario navigare da casa con l''ADSL Vodafone e la Internet Key inserita nell''apposito alloggiamento della Vodafone Station. Per registrarti utilizza come identificativo il numero della tua Internet Key abbinata alla Vodafone Station (Non lo ricordi? <a href=\"http:\/\/www.vodafone.it\/portal\/client\/cms\/viewCmsPage.action?pageId=42375\">Clicca qui<\/a>).<\/span>', '');
